        {
            free(pbFileBuffer);
            return e_progressError;
        }
        if(!m_file->readBlock(pbFileBuffer+m_byteArray[1], m_byteArray[2], m_byteArray[3]))
        {
            free(pbFileBuffer);
            return e_progressError;
        }
        
        SHA1_Update(&m_sSHA_CTX, pbFileBuffer, nFileLength);
        free(pbFileBuffer);
        
        
        return e_progressFinished;
